from flask import Flask, request, jsonify
import sqlite3
import base64
import re

app = Flask(__name__)

DATABASE = 'ctf.db'

ADMIN_PROMO = 'Fl4gm4r7_5p3c14l_Pr0m0_F0r_1337_H4ck3r5'

FLAGS = {
    'flag_bd': {'name': 'Bangladesh', 'price': 55, 'value': ''},
    'flag_bt': {'name': 'Bhutan', 'price': 58, 'value': ''},
    'flag_np': {'name': 'Nepal', 'price': 50, 'value': ''},
    'flag_mv': {'name': 'Maldives', 'price': 70, 'value': ''},
    'flag_lk': {'name': 'Sri Lanka', 'price': 60, 'value': ''},
    'special': {'name': 'BUETCTF', 'price': 13371337,'value': ''}
}



def get_db():
    conn = sqlite3.connect(DATABASE)
    conn.row_factory = sqlite3.Row 
    return conn

def init_db():
    with get_db() as conn:
        cur = conn.cursor()
        cur.execute('''
            CREATE TABLE IF NOT EXISTS users (
                id INTEGER PRIMARY KEY AUTOINCREMENT,
                username TEXT UNIQUE NOT NULL,
                password TEXT NOT NULL,
                balance INTEGER DEFAULT 100,
                is_admin INTEGER DEFAULT 0,
                promo_code TEXT DEFAULT '',
                unlocked_special INTEGER DEFAULT 0
            )
        ''')

        cur.execute("SELECT * FROM users WHERE username = 'admin'")
        if not cur.fetchone():
            cur.execute('''
                INSERT INTO users (username, password, balance, is_admin, promo_code, unlocked_special)
                VALUES ('admin', 'BUETCTFFl4GMar7Adm1n1337', 0, 1, ?, 1)
            ''', (ADMIN_PROMO,))
        conn.commit()

init_db()

def encode_token(user_id):
    return base64.b64encode(str(user_id).encode()).decode()

def decode_token(token):
    try:
        return int(base64.b64decode(token).decode())
    except:
        return None

def get_user_by_id(user_id):
    with get_db() as conn:
        cur = conn.cursor()
        cur.execute("SELECT * FROM users WHERE id = ?", (user_id,))
        return cur.fetchone()


@app.route('/register', methods=['POST'])
def register():
    data = request.json
    username = data.get('username', '').strip()
    password = data.get('password', '')


    if not username or not password:
        return jsonify('ERROR: Missing fields'), 400


    if len(username) < 4:
        return jsonify('Username must be at least 4 characters'), 400


    if len(password) < 6:
        return jsonify('Password must be at least 6 characters'), 400

    password_regex = re.compile(r'^(?=.*[a-z])(?=.*[A-Z])(?=.*\d)(?=.*[^\w\s]).+$')
    if not password_regex.match(password):
        return jsonify('Password must include uppercase, lowercase, number, and special character'), 400

    with get_db() as conn:
        cur = conn.cursor()
        try:
            cur.execute('''
                INSERT INTO users (username, password, balance, is_admin, promo_code)
                VALUES (?, ?, 300, 0, '')
            ''', (username, password))
            conn.commit()
            return jsonify({'msg': 'Registered'})
        except sqlite3.IntegrityError:
            return jsonify({'ERROR': 'Username exists'}), 400
                

@app.route('/login', methods=['POST'])
def login():
    data = request.json
    username = data.get('username')
    password = data.get('password')
    with get_db() as conn:
        cur = conn.cursor()
        cur.execute("SELECT * FROM users WHERE username = ? AND password = ?", (username, password))
        user = cur.fetchone()
        if user:
            token = encode_token(user['id'])
            return jsonify({
                'token': token,
                'username': user['username'],
                'is_admin': user['is_admin']
            })
        else:
            return jsonify({'ERROR': 'Invalid credentials'}), 401

