@app.route('/flags', methods=['GET'])
def get_flags():
    token = request.headers.get('Authorization')
    if not token:
        return jsonify({'error': 'Missing token'}), 401

    user_id = decode_token(token)
    if user_id is None:
        return jsonify({'error': 'Invalid token'}), 401

    user = get_user_by_id(user_id)
    if not user:
        return jsonify({'error': 'User not found'}), 404

    available_flags = {}

    for key, flag in FLAGS.items():
        if key == 'special' and not user['unlocked_special']:
            continue

        available_flags[key] = {
            'name': flag['name'],
            'price': flag['price']
        }

    return jsonify(available_flags)

@app.route('/buy_flag', methods=['POST'])
def buy_flag():
    token = request.headers.get('Authorization')
    if not token:
        return jsonify({'ERROR': 'Missing token'}), 401
    user_id = decode_token(token)
    if user_id is None:
        return jsonify({'ERROR': 'Invalid token'}), 401
    user = get_user_by_id(user_id)
    if not user:
        return jsonify({'ERROR': 'User not found'}), 404
    data = request.json
    flag_name = data.get('flag_name')
    if flag_name not in FLAGS:
        return jsonify({'ERROR': 'Invalid flag'}), 400
    if flag_name == 'special' and not user['unlocked_special']:
        return jsonify({'ERROR': 'Special flag locked'}), 403
    price = FLAGS[flag_name]['price']
    if user['balance'] < price:
        return jsonify({'ERROR': 'Insufficient balance'}), 400
    with get_db() as conn:
        cur = conn.cursor()
        cur.execute("UPDATE users SET balance = balance - ? WHERE id = ?", (price, user_id))
        conn.commit()
    return jsonify({'flag': FLAGS[flag_name]['value']})

@app.route('/redeem_promo', methods=['POST'])
def redeem_promo():
    token = request.headers.get('Authorization')
    if not token:
        return jsonify({'ERROR': 'Missing token'}), 401
    user_id = decode_token(token)
    if user_id is None:
        return jsonify({'ERROR': 'Invalid token'}), 401
    user = get_user_by_id(user_id)
    if not user:
        return jupytext({'ERROR': 'User not found'}), 404
    data = request.json
    code = data.get('code')
    if code != ADMIN_PROMO:
        return jsonify({'ERROR': 'Invalid promo code'}), 400
    with get_db() as conn:
        cur = conn.cursor()
        cur.execute("UPDATE users SET unlocked_special = 1 WHERE id = ?", (user_id,))
        conn.commit()
    return jsonify({'msg': 'Special flag unlocked'})


@app.route('/transfer', methods=['POST'])
def transfer():
    token = request.headers.get('Authorization')
    if not token:
        return jsonify({'ERROR': 'Missing token'}), 401

    sender_id = decode_token(token)
    if sender_id is None:
        return jsonify({'ERROR': 'Invalid token'}), 401

    sender = get_user_by_id(sender_id)
    if not sender:
        return jsonify({'ERROR': 'User not found'}), 404

    data = request.json
    to_username = data.get('to_username')
    amount = data.get('amount')

    if not to_username or not isinstance(amount, int):
        return jsonify({'ERROR': 'Missing or invalid fields'}), 400


    if to_username == sender['username']:
        return jsonify({'ERROR': 'Cannot transfer balance to yourself'}), 400

    with get_db() as conn:
        cur = conn.cursor()
        cur.execute("SELECT * FROM users WHERE username = ?", (to_username,))
        receiver = cur.fetchone()
        if not receiver:
            return jsonify({'ERROR': 'Receiver not found'}), 404

        if amount > 0 and amount > sender['balance']:
            return jsonify({'ERROR': 'Insufficient balance'}), 400

     
        cur.execute("UPDATE users SET balance = balance - ? WHERE id = ?", (amount, sender_id))
        cur.execute("UPDATE users SET balance = balance + ? WHERE id = ?", (amount, receiver['id']))
        conn.commit()

    return jsonify({'msg': 'Transfer complete'})

